    align-items: center;
    align-content: center;
    margin-bottom: 24px;
    position: relative;
`

export default function CategoriesShowcase() {
    return (
        <Container>
            <h3 style={{ marginTop: 0 }}>Explore our various categories</h3>
        </Container>
    )
}
